        <>
            <h1 className='mt-5 text-center main-heading'>Select your favorite Picture</h1>
            <div className='menu-tabs container'>
                <div className='menu-tab d-flex justify-content-around'>

                </div>

            </div>
        </>
    )
}

export default FilterGallery;
